import React from 'react';

const Navbar = () => {
    return (
        <div>
            <nav className="navbar navbar-dark bg-dark">
                <div className="container">
                <a className="navbar-brand" href="#">Navbar</a>
                <ul className="nav navbar-nav flex-row float-left">
                    <li className="nav-item"><a className="nav-link pr-4 active" href="index.html">Search</a></li>
                    <li className="nav-item"><a className="nav-link pr-4" href="portfolio.html">Saved</a></li>
                </ul>
                </div>
            </nav>
        </div>
    )
}
export default Navbar;
